        {/* <SassComponent /> */}
      </div>

    )
  }
}

// skip menu
function Skipmenu()  {
  return (
    <div id="skipmenu">
      <a href="/">Go to Main Menu</a>
      <a href="/">Go to Products</a>
    </div>
  )
}

